import Form from './test_input';


export default class NotFound extends Component{
    constructor() {
        super();
        this.state = {
            dataFinal: [],
        }
    }

    componentDidMount() {

    }

    handleSubmit(){
        console.log(this.state.dataFinal);
        // console.log('submit');


    }

    getDataForPdf(e) {
        this.setState({ dataFinal: [... this.state.dataFinal, e] })
        // console.log(this.state.service);
    }

    render(){

        return(
            <div className="container">
            <form onSubmit={this.handleSubmit.bind(this)}>
                <Form getDataForPdf={this.getDataForPdf.bind(this)} />
            </form>
            <div className="text-center">
                <input type="submit" value="Submit" className="degrade-btn btn" style={{ borderRadius: '5%', width: '15vh', marginTop: "3%"}} />
            </div>
            </div>
        )
    }
}
